import {map} from '@iterable-iterator/map';
import {filter} from '@iterable-iterator/filter';
import {NotImplementedError} from '@failure-abstraction/error';
import iterableFromMap from './iterableFromMap.js';

export default class BasePairs {
	// Set-like
	add() {
		throw new NotImplementedError('BasePairs#add: Not implemented.');
	}

	clear() {
		throw new NotImplementedError('BasePairs#clear: Not implemented.');
	}

	delete() {
		throw new NotImplementedError('BasePairs#delete: Not implemented.');
	}

	has([A, B]) {
		return this._map.has(A) && this._map.get(A).has(B);
	}

	values() {
		return iterableFromMap(this._map);
	}

	*entries() {
		for (const value of this.values()) yield [value, value];
	}

	keys() {
		return this.values();
	}

	[Symbol.iterator]() {
		return this.values();
	}

	forEach(callbackFn, thisArg = this) {
		for (const value of this.values()) callbackFn.call(thisArg, value);
	}

	// Custom

	update(pairs) {
		for (const pair of pairs) this.add(pair);
		return this;
	}

	left() {
		return this._map.keys();
	}

	right() {
		return new Set(map((x) => x[1], this.values())).keys();
	}

	*rightOf(A) {
		if (this._map.has(A)) yield* this._map.get(A);
	}

	leftOf(B) {
		return map(
			(x) => x[0],
			filter((x) => B === x[1], this.values()),
		);
	}
}

import BasePairs from './BasePairs.js';
import insert from './insert.js';
import remove from './remove.js';

export default class EfficientlyInvertiblePairs extends BasePairs {
	static from(pairs) {
		const set = new EfficientlyInvertiblePairs(new Map(), new Map(), 0);
		return set.update(pairs);
	}

	// Set-like

	constructor(map, imap, size) {
		super();
		this._map = map;
		this._imap = imap;
		this.size = size;
	}

	add([A, B]) {
		if (!this.has([A, B])) {
			insert(this._map, A, B);
			insert(this._imap, B, A);
			++this.size;
		}

		return this;
	}

	clear() {
		this.size = 0;
		this._map.clear();
		this._imap.clear();
		return undefined;
	}

	delete([A, B]) {
		if (remove(this._map, A, B)) {
			remove(this._imap, B, A);
			--this.size;
			return true;
		}

		return false;
	}

	// Custom

	right() {
		return this._imap.keys();
	}

	*leftOf(B) {
		if (this._imap.has(B)) yield* this._imap.get(B);
	}

	invert() {
		return new EfficientlyInvertiblePairs(this._imap, this._map, this.size);
	}
}

import BasePairs from './BasePairs.js';
import insert from './insert.js';
import remove from './remove.js';
import invertIterable from './invertIterable.js';

export default class MemoryEfficientPairs extends BasePairs {
	static from(pairs) {
		const set = new MemoryEfficientPairs(new Map(), 0);
		return set.update(pairs);
	}

	// Set-like

	constructor(map, size) {
		super();
		this._map = map;
		this.size = size;
	}

	add([A, B]) {
		if (!this.has([A, B])) {
			insert(this._map, A, B);
			++this.size;
		}

		return this;
	}

	clear() {
		this.size = 0;
		this._map.clear();
		return undefined;
	}

	delete([A, B]) {
		if (remove(this._map, A, B)) {
			--this.size;
			return true;
		}

		return false;
	}

	// Custom

	invert() {
		return MemoryEfficientPairs.from(invertIterable(this.values()));
	}
}

export {default as BasePairs} from './BasePairs.js';
export {default as EfficientlyInvertiblePairs} from './EfficientlyInvertiblePairs.js';
export {default as MemoryEfficientPairs} from './MemoryEfficientPairs.js';
export {default as insert} from './insert.js';
export {default as invertIterable} from './invertIterable.js';
export {default as iterableFromMap} from './iterableFromMap.js';
export {default as remove} from './remove.js';
export {default as swap} from './swap.js';

export default function insert(map, A, B) {
	if (map.has(A)) {
		map.get(A).add(B);
	} else {
		map.set(A, new Set([B]));
	}
}

import {map} from '@iterable-iterator/map';
import swap from './swap.js';

export default function invertIterable(iterable) {
	return map(swap, iterable);
}

export default function* iterableFromMap(map) {
	for (const [A, others] of map.entries()) {
		for (const B of others.values()) yield [A, B];
	}
}

export default function remove(map, A, B) {
	if (map.has(A)) {
		const right = map.get(A);
		if (right.delete(B)) {
			if (right.size === 0) map.delete(A);
			return true;
		}
	}

	return false;
}

export default function swap([A, B]) {
	return [B, A];
}

